import React from "react";
import arr from "./all/50.mp4";
import "./App.css";
import ReactPlayer from "react-player";

const App = () => {
  return (
    <div className="video">
      <video width="320" height="240" controls autoPlay>
              <ReactPlayer className="contain" url={arr}  loop muted playing></ReactPlayer>
      </video>
    </div>
  );
};

export default App;
